INSERT INTO `zero_dict_biz` VALUES (1802579023484985346, '000000', 0, 'professional_investor_statement', '-1', '专业投资者声明', 1, '专业投资者声明内容文本信息字典可修改维护', 0, 0, '-1', '專業投資者聲明', NULL, NULL);
INSERT INTO `zero_dict_biz` VALUES (1802584343775059969, '000000', 1802579023484985346, 'professional_investor_statement', 'item-1-a', '本人谨此声明本人为个人客户在考虑以下任何一项或多于一项时，拥有的投资组合在有关日期不少于$8,000,000港币(或等值货币)。', 1, '「专业投资者」的待遇', 0, 0, 'item-1-a', '本人謹此聲明本人為個人客戶在考慮以下任何一項或多於一項時，擁有的投資組合在有關日期不少於$8,000,000港幣(或等值貨幣)。', NULL, NULL);
INSERT INTO `zero_dict_biz` VALUES (1802584480203186178, '000000', 1802579023484985346, 'professional_investor_statement', 'item-2', '本人明白狮瀚环球，根据证券及期货条例于香港证券及期货监察委员会注册之持牌机构经营第一类(证券交易)及第四类(就证券提供意见)之受规管活动，在向本人提供服务的同时，一般情况下须遵守「操守准则」中所订与业务操守有关的规则。然而，狮瀚环球在某些情况下，在与「操守准则」中定义之「专业投资者」往来时，可获免除遵守「操守准则」中一些与业务操守有关的特定规则。', 3, '遵守「操守准则」', 0, 0, 'item-2', '本人明白獅瀚環球，根據證券及期貨條例於香港證券及期貨監察委員會註冊之持牌機構經營第一類(證券交易)及第四類(就證券提供意見)之受規管活動，在向本人提供服務的同時，一般情況下須遵守「操守準則」中所訂與業務操守有關的規則。然而，獅瀚環球在某些情況下，在與「操守準則」中定義之「專業投資者」往來時，可獲免除遵守「操守準則」中一些與業務操守有關的特定規則。', NULL, NULL);
INSERT INTO `zero_dict_biz` VALUES (1802584905857933313, '000000', 1802579023484985346, 'professional_investor_statement', 'item-3', '本人明白本人于任何时候均拥有权利反对及撤回被视为「专业投资者」的资格，唯该等要求需要最少五个工作日前向狮瀚环球以书面提出。本人同意除非及直至狮瀚环球收到本人有关的反对及撤回资格之书面通知，狮瀚环球有权将本人视为「专业投资者，及本人将承担相关的风险及后果。有关任何本人撤「专业投资者」资格的要求，在该撤回要求生效前，均不会妨碍及影响狮瀚环球向本人提供的服务。', 4, '撤回被视为 「专业投资者」的资格', 0, 0, 'item-3', '本人明白本人於任何時候均擁有權利反對及撤回被視為「專業投資者」的資格，唯該等要求需要最少五個工作日前向獅瀚環球以書面提出。本人同意除非及直至獅瀚環球收到本人有關的反對及撤回資格之書面通知，獅瀚環球有權將本人視為「專業投資者，及本人將承擔相關的風險及後果。有關任何本人撤「專業投資者」資格的要求，在該撤回要求生效前，均不會妨礙及影響獅瀚環球向本人提供的服務。', NULL, NULL);
INSERT INTO `zero_dict_biz` VALUES (1802587830554501122, '000000', 1802579023484985346, 'professional_investor_statement', 'item-1-b', '本人进一步确认本人将会/已经向狮瀚环球提供所有于指定期内发出的相关证明文件，以证明本人符合《证券及期货条例》(第571 章)(下称「证券及期货条例」)中有关「专业投资者的定义所描述的人士。同时，本人现亦就本人于狮瀚环球持有的交易账户，向狮瀚环球申请成为《证券及期货事务监察委员会持牌人或注册人操守准则》(下称「操守准则」)定义的「专业投资者」。', 2, '「专业投资者」的待遇', 0, 0, 'item-1-b', '本人進一步確認本人將會/已經向獅瀚環球提供所有於指定期內發出的相關證明文件，以證明本人符合《證券及期貨條例》(第571 章)(下稱「證券及期貨條例」)中有關「專業投資者的定義所描述的人士。同時，本人現亦就本人於獅瀚環球持有的交易賬戶，向獅瀚環球申請成為《證券及期貨事務監察委員會持牌人或註冊人操守準則》(下稱「操守準則」)定義的「專業投資者」。', NULL, NULL);
